func compareCardLists(t *testing.T, results []*Card, compareTo []string) {
improperLoop:
	for _, card := range results {
		for _, name := range compareTo {
			if name == card.Name {
				continue improperLoop
			}
		}
		t.Errorf("Improperly detected %s.\n", card.Name)
	}

failureLoop:
	for _, name := range compareTo {
		for _, card := range results {
			if name == card.Name {
				continue failureLoop
			}
		}
		t.Errorf("Failed to detect %s.\n", name)
	}
}

func TestStandard(t *testing.T) {
	m := getTestingMultiverse(t)

	cards, err := m.Search(Formats.Standard)

	if err != nil {
		t.Fatalf("Search failed: %s", err.Error())
	}

	compareCardLists(t, cards, standardCards)
}

